function About() {
    return (
      <div className="Home">
        <header className="home-header">
            
          <div>
            <h1 id="title">HACKER CONNECTED</h1>
          </div>
          <div id="welcome">
            <h2>Welcome to the social network for hackers!</h2>
          </div>
        </header>
      </div>
    );
  }
  
  export default About;
